import React, {useState, useMemo} from 'react';

const Table = () => {

	return(
		<table className="table table-bordered">
		    <thead>
		      <tr>
		      	<th>id</th>
		        <th>Title</th>
		        <th>Completed</th>
		        <th>Action</th>
		      </tr>
		    </thead>
		    <tbody>
		    	{showData}
		    </tbody>
		  </table>
	)
	
}

export default Table;
